import { UserRouteAccessService } from 'app/core';

import { Route } from '@angular/router';
import {FirstItemAComponent} from "app/entities/kg/kg-search/first-item-a.component";
import {FirstItemBComponent} from "app/entities/kg/first-item-b/first-item-b.component";

export const first: Route = {
    path: 'first',
    children: [
        {
            path: '',
            redirectTo: 'item-a',
            pathMatch: 'full'
        },
        {
            path: 'item-a',
            component: FirstItemAComponent,
            data: {

            },
            canActivate: [UserRouteAccessService]
        },
        {
            path: 'item-b',
            component: FirstItemBComponent,
            data: {
                pageTitle: 'item.itemA'
            },
            canActivate: [UserRouteAccessService]
        },

    ]
};
